import React from "react";
import {Route} from "react-router-dom"
import Landing from "./Landing";

const Routes = () =>{

    return(
        <div className="Routes">
        <Route exact path="/" component={Landing}/>
        <Route path="/register"/>
        <Route path="/home"/>
        </div>
    )
}

export default Routes;
